var UIBlockUI = function () {
    var o = function () {
            $("#video-uploader").change(function () {
                App.blockUI({
                    target: "#video-upload-portlet",
                    boxed: !0
                }), window.setTimeout(function(){
                    App.unblockUI('#video-upload-portlet');
                },2e3)
            }) 
                
        }
    return {
        init: function () {
            o()
        }
    }
}();
jQuery(document).ready(function () {
    UIBlockUI.init()
});